css:
@-moz-document url-prefix("https://osusearch.com") {
.beatmap .beatmap-image { 
	display:none !important; 
} 
.beatmap .beatmap-info { 
	display:none !important; 
} 
.beatmap .beatmap-difficulties { 
	display:none !important; 
} 
.beatmap .label { 
	display:none !important; 
} 
.ui[class*="three column"].grid>.column:not(.row), .ui[class*="three column"].grid>.row>.column {
    width: 5%;
}
i.ban.icon.beatmap-icon {
    display: none;
}
.beatmap-icon-container a:nth-child(2) {
    display: none;
}
}
